<!DOCTYPE html>
<html lang="id">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Chat Builder by Yan</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    html, body {
      width: 100%;
      height: 100%;
      font-family: 'Segoe UI', sans-serif;
      background-color: #121212;
      overflow: hidden;
    }

    #app {
      display: flex;
      flex-direction: column;
      height: 100%;
    }

    #chat-container {
      flex: 1;
      overflow-y: auto;
      padding: 15px;
      background: #1a1a1a;
      display: flex;
      flex-direction: column;
      scroll-behavior: smooth;
      max-height: 90vh; 
    }

    .bubble {
      max-width: 80%;
      padding: 10px 15px;
      margin: 6px 0;
      border-radius: 18px;
      position: relative;
      animation: fadeIn 0.3s ease;
      word-wrap: break-word;
    }

    .you {
      align-self: flex-end;
      background-color: #00c3ff;
      color: black;
      border-bottom-right-radius: 0;
    }

    .other {
      align-self: flex-start;
      background-color: #2e2e2e;
      color: white;
      border-bottom-left-radius: 0;
    }

    .sender {
      font-size: 12px;
      color: #ccc;
      margin-bottom: 4px;
    }

    #input-area {
      position: fixed;
      bottom: 0;
      left: 0;
      right: 0;
      background: #1e1e1e;
      padding: 10px;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 10px;
      box-sizing: border-box;
    }

    #msg {
      flex: 1;
      padding: 12px 15px;
      font-size: 16px;
      border: none;
      border-radius: 25px;
      background: #2e2e2e;
      color: white;
      outline: none;
    }

    button {
      padding: 10px 16px;
      background: #00c3ff;
      color: black;
      border: none;
      border-radius: 25px;
      font-weight: bold;
      cursor: pointer;
    }

    
#notification {
  position: fixed;
  top: 10px;
  left: 50%;
  transform: translateX(-50%);
  background-color: #222;
  color: #fff;
  padding: 8px 16px;
  border-radius: 12px;
  font-size: 14px;
  z-index: 999;
  opacity: 1;
  transition: opacity 1s ease-in-out, top 0.5s ease-in-out;
}
#notification.fade-out {
  opacity: 0;
  top: -40px;
}


    #footer {
      text-align: center;
      font-size: 12px;
      color: #777;
      padding: 5px;
      background: #121212;
    }

    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(10px); }
      to { opacity: 1; transform: translateY(0); }
    }
  </style>
</head>
<body>
  <div id="notification" style="display:none;"></div>
  <div id="app">
    <div id="chat-container"></div>

    <div id="input-area">
      <input id="msg" type="text" placeholder="Tulis pesan..." />
      <button onclick="sendMessage()">Kirim</button>
    </div>

    <div id="footer">Public Message</div>
  </div>

  
  <script src="https://www.gstatic.com/firebasejs/8.10.0/firebase-app.js"></script>
  <script src="https://www.gstatic.com/firebasejs/8.10.0/firebase-database.js"></script>
  <script>
    const firebaseConfig = {
      apiKey: "AIzaSyBVMpOCjY9gdd4UkSa",
      authDomain: "yanofc-1ecd3.firebaseapp.com",
      databaseURL: "https://yanofc-1ecd3-default-rtdb.asia-southeast1.firebasedatabase.app",
      projectId: "yanofc-1ecd3",
      storageBucket: "yanofc-1ecd3.appspot.com",
      messagingSenderId: "843043156565",
      appId: "1:843043156565:web:e00942a837d30e4b4a9adc"
    };
    firebase.initializeApp(firebaseConfig);
    const db = firebase.database();

    const chatContainer = document.getElementById("chat-container");

    let username = localStorage.getItem("chat_username");
    if (!username) {
      username = prompt("Masukkan namamu:");
      if (!username) username = "Anonim";
      localStorage.setItem("chat_username", username);
    }

    const toxicWords = ["kontol", "memek", "ngentot", "anjing", "babi", "bangsat", "k0nt0l"];
    function sanitize(text) {
      let clean = text;
      toxicWords.forEach(word => {
        const regex = new RegExp(word, "gi");
        clean = clean.replace(regex, "⚠️ Blocked By Admin");
      });
      return clean;
    }

    function sendMessage() {
      const msg = document.getElementById("msg").value.trim();
      if (msg !== "") {
        db.ref("chat").push({
          name: sanitize(username),
          message: sanitize(msg),
          time: Date.now()
        });
        document.getElementById("msg").value = "";
      }
    }
    
    function random(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

    db.ref("chat").on("child_added", snapshot => {
  const data = snapshot.val();
  const bubble = document.createElement("div");
  bubble.classList.add("bubble");
  bubble.classList.add(data.name === username ? "you" : "other");
  bubble.innerHTML = `
    <div class="sender">${data.name}</div>
    <div>${data.message}</div>
  `;
  chatContainer.appendChild(bubble);

  setTimeout(() => {
    chatContainer.scrollTop = chatContainer.scrollHeight;
  }, 100);

  
  const notification = document.getElementById("notification");
  
  if (data.name === username) {
  fetch('https://api.ipify.org?format=json')
    .then(res => res.json())
    .then(ipData => {
      notification.innerHTML = `IP ${data.name}: ${ipData.ip}`;
      notification.classList.remove("fade-out");
      notification.style.display = 'block';

      setTimeout(() => {
        notification.classList.add("fade-out");
      }, 4000); 

      setTimeout(() => {
        notification.style.display = 'none';
      }, 5000); 
    });
} else {
  const fakeIP = `${random(1,255)}.${random(1,255)}.${random(1,255)}.${random(1,255)}`;
  notification.innerHTML = `IP ${data.name}: ${fakeIP}`;
  notification.classList.remove("fade-out");
  notification.style.display = 'block';

  setTimeout(() => {
    notification.classList.add("fade-out");
  }, 4000);

  setTimeout(() => {
    notification.style.display = 'none';
  }, 5000);
}
    
});
  </script>
</body>
</html>
